const Course = ({curso}) => {
    console.log(curso);
    <h1>{curso.name}</h1>
    { curso.parts.map(parte => (<p key={parte.id} >{parte.name} {parte.exercises}</p>)) }
    <SumaEx course={curso} />
}
export default Course
